        <p className='catagory'> Novel & Life </p>
        <div className='bookline'> </div>
        <img src={book.image} alt=' ' className='seminewbook' />
        <p className='name' >{book.name} <br /> <span className='writer'>{book.writer} </span> <br /> </p>
